import styled from "styled-components";
import MainIMGs from "../components/RandomIMGs";

const MainGallery = styled.ul`
  width: 100%;
  height: 200vh;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: repeat(auto, 300px);
  gap: 1px;
  overflow-y: scroll;
`;

function Main() {
  return (
    <div id="GlobalContainer">
      <MainGallery>
        <MainIMGs />
      </MainGallery>
    </div>
  );
}

export default Main;
